import React from 'react';
import HomePage from '../static/media/HomePage.mov';

const Video = () => {
  return (
    <video className="videoTag h-auto" autoPlay loop>
      <source src={HomePage} type="video/mp4" />
    </video>
  );
};

export default Video;
